import React from "react";

const Header = ({ scrollToSection }) => {
    const handleScrollToSection = (index) => {
        scrollToSection(index);
    };

    return (
        <header>
            <nav>
                <ul>
                    <li onClick={() => handleScrollToSection(0)}>Intro</li>
                    <li onClick={() => handleScrollToSection(1)}>Skill</li>
                    <li onClick={() => handleScrollToSection(2)}>Project</li>
                    <li onClick={() => handleScrollToSection(3)}>Resume</li>
                    <li onClick={() => handleScrollToSection(4)}>Contact</li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
